            break;
    }
}

console.log('Calculate results');

const spectra=JSON.parse(JSON.stringify(API.getData('spectraInDataset')));

const ranges=API.getData('ranges').resurrect();
const spectraProcessor=API.cache('spectraProcessor');

spectraProcessor.updateRangesInfo(ranges);

// we prepare the data
for (let spectrum of spectra) {
    let processorSpectrum=spectraProcessor.getSpectrum(spectrum.id);
    if (processorSpectrum) {
        spectrum.ranges=processorSpectrum.ranges;
        spectrum.xy={
            x: processorSpectrum.normalized.x,
            y: processorSpectrum.normalized.y
        }
        if (spectrum.toc) spectrum.toc=spectrum.toc.value;   
    }
    delete spectrum._highlight;
    spectrum.results={};
}

let templateID = API.getData('currentTemplateResults') && API.getData('currentTemplateResults').$id && API.getData('currentTemplateResults').$id[3];


let chart = getChart();

let data = {
    spectra,
    report: {},
    user: API.cache('userInfo'),
    description: API.getData('description'),
    templateID,
    chart,
    svg: {
        type: 'svg',
        value: API.getData('svg')
    }
}

const code=`{
    ${API.getData('code')}
}`;

const fct = new Function('data', 'Color', code);

API.createData('results', []);

try {
    fct(data, Color);
} catch (e) {
    let line=e.stack.split('\n')[1].replace(/.*:(.*):.*/,'$1')-3;
    let message=`line ${line} - ${e.name}: ${e.message}`
    UI.showNotification(message, 'warning');
}

API.createData('data', data);

// API.createData('dataSample', data);
API.createData('dataSample', cloneDeepLimitArray(data.resurrect()))


function getChart() {
    let chart=JSON.parse(JSON.stringify(API.getData('chart')));
    let preferences=API.getData('preferences').resurrect();
    chart={series: chart.data.map( entry => {return {
        type: 'line',
        data: {x:entry.x, y:entry.y},
        style: {
            line: {
                color: entry.styles.unselected.lineColor
            }
        }
    }})};

    const spectraDataSet=API.cache('spectraDataSet');
    const chartPrefs = spectraDataSet.getChartPrefs();
    chart.axes={
        x: {
            label: chartPrefs.xLabel,
            flipped: chartPrefs.displayXAxis.includes('flip'),
            forcedMin: preferences.normalization.from,
            forcedMax: preferences.normalization.to,
        },
        y: {
            label: chartPrefs.yLabel,
            flipped: chartPrefs.displayYAxis.includes('flip'),
        }
    }

    chart.annotations=[];

    if (API.getData('rangeAnnotations')) {
        for (let annotation of JSON.parse(JSON.stringify(API.getData('rangeAnnotations')))) {
            chart.annotations.push({
                type: annotation.type,
                properties: annotation
            })
        }
    }

    if (API.getData('filterAnnotations')) {
        for (let annotation of JSON.parse(JSON.stringify(API.getData('filterAnnotations')))) {
            chart.annotations.push({
                type: annotation.type,
                properties: annotation
            })
        }
    }
    return chart;
}

if (! this.button) this.button='default';

var layers={
